import React from 'react';
import { Box } from '@mui/material';

const AvatarComponent = () => {
  return (
    <Box
      sx={{
        width: '15%',
        bgcolor: '#f5f5f5',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        p: 2,
      }}
    >
      <Box
        sx={{
          width: 50,
          height: 50,
          borderRadius: '50%',
          bgcolor: '#bbb',
          mb: 2,
        }}
      ></Box>
    </Box>
  );
};

export default AvatarComponent;
